Sympathy for the Devil is a song by The Rolling Stones which first appeared as the opening track on the band's 1968 album Beggars Banquet. It was written by Mick Jagger and Keith Richards. Rolling Stone magazine placed it at #32 in their list of the 500 Greatest Songs of All Time.

Norman Quentin Cook (born Quentin Leo Cook, 31 July 1963), also known by the stage name Fatboy Slim, is an English DJ, big beat musician, record producer and pioneer of the electronic dance genre that achieved mainstream popularity in the 1990s. Cook has achieved considerable success in the UK charts, performing as Fatboy Slim and with The Housemartins, Beats International and Freak Power. He currently performs as the Brighton Port Authority.
